// new date ex. Fri Mar 17 2023 16:59:43 GMT-0400 (Eastern Daylight Time)
// getDate() => 17
// getMonth() + 1 because its 0-index => 3

function App() {
  function getDate() {
    const myDate = new Date();
    console.log('mydate', myDate);
    console.log('getMonth', myDate.getMonth()); 
  };

  return (
    <div className="App">
      <button onClick={getDate}>get date</button>
    </div>
  );
}

export default App;
